      de leurs d\xE9partement, et\",\"publiques ainsi qu\u2019au nom de la Premi\xE8re
      ministre, tous actes relevant des attributions de leurs d\xE9partement, et \\nnotamment
      les conventions, commandes et certifications de services faits d\u2019un montant
      strictement inf\xE9rieur \\n\xE0 208 000 \u20AC hors taxes, aux agents suivants
      : \\n\u2013 M. Ishan Bhojwani, agent contractuel, chef du d\xE9partement \xAB
      Incubateur de services num\xE9riques \xBB (ISN) ; \\n\u2013 Mme Marielle Chrisment,
      lieutenante-colonelle de gendarmerie, cheffe du d\xE9partement \xAB Etalab \xBB
      ; \\n\u2013 M. Guy Duplaquet, ing\xE9nieur g\xE9n\xE9ral des mines, chef du
      d\xE9partement \xAB Infrastructures et services op\xE9r\xE9s \xBB \\n(ISO) ;
      \\n\u2013 M. Florian Delezenne, agent contractuel, chef du d\xE9partement \xAB
      Op\xE9rateur de produits interminist\xE9riels \xBB \\n(OPI). \\nArt. 2. \u2013
      D\xE9l\xE9gation est donn\xE9e \xE0 l\u2019effet de signer au nom du ministre
